I’ve always said: do what works for you.  I want my page to be a place of motivation and asking questions…but also a page where you can see that when you find what works, it changes everything!  Just because you don’t keto doesn’t mean you shouldn’t be here.  Find your groove and if my page helps others, great!  It’s about trying something and being willing to pivot if that doesn’t work.  It’s giving yourself grace in the process.  It’s not “failing” and giving up…it’s being open to trying something else.  I had tried multiple diets: HCG Drops, Slim Fast, Herbal Life, Eating 500 calories a day, doing zumba 5 days a week…none of it worked!  Keto/Low Carb has worked for me!  And walking of course. 🤍 
That part:  FOOD AND MOVEMENT YOU ENJOY!
@banhass
